Helper for easy and elegant type conversions, taking care of: nullables, enums, System.DBNull and other types inherit from System.IConvertible. The method try convert to specified type, if the conversion fail, there is an option to define a fallback value to be returned as result.

Example:
int converted = someObject.ConvertToOrDefault<int>(-1);

A client API in ASP.NET and C# that can be used to interact with a-webshop. You can use this client API to create applications in ASP.NET that interacts with a-webshop. The documentation for the API is under development, more information will come later.

A quick start guide
Create an administrator in a-webshop with a API role, there is three different roles (API Full Trust, API Medium Trust, API Minimal Trust).

The namespace for the API is Annytab.WebshopClientAPI. You need to create a ClientConnection before you call methods in the API. All the methods is async so need to specify the await keyword before the method call.

// Create the connection
ClientConnection connection = new ClientConnection("https://localhost:44301", "TestAPI", "test");

// Get posts
List<Campaign> campaigns = await Campaign.GetAll(connection, 0, "id", "ASC");

// Dispose of the connection
connection.Dispose();

Using it
First one time wire in the manager:-

{
    InitializeComponent();

    if (!VirtualizationManager.IsInitialized)
    {
        //set the VirtualizationManager’s UIThreadExcecuteAction. In this case
        //we’re using Dispatcher.Invoke to give the VirtualizationManager access
        //to the dispatcher thread, and using a DispatcherTimer to run the background
        //operations the VirtualizationManager needs to run to reclaim pages and manage memory.
        VirtualizationManager.Instance.UIThreadExcecuteAction = 
            (a) => Dispatcher.Invoke(a);
        new DispatcherTimer(
            TimeSpan.FromSeconds(1),
            DispatcherPriority.Background,
            delegate(object s, EventArgs a)
            {
                VirtualizationManager.Instance.ProcessActions();
            },
            this.Dispatcher).Start();
    }
    //the rest of the constructor goes here
}

Then create a Paginated source:
public class TesterSource : IPagedSourceProvider<SimpleDataItem>
{
    public PagedSourceItemsPacket<SimpleDataItem> GetItemsAt(int pageoffset, int count, bool usePlaceholder)
    {
       return new PagedSourceItemsPacket<SimpleDataItem>() 
           { LoadedAt = DateTime.Now, 
             Items = (from items in SimpleDataSource.Instance.Items select items).Skip(pageoffset).Take(count) 
           };
    }
    public int Coun{
        get { return SimpleDataSource.Instance.Items.Count; }
    }
    public int IndexOf(SimpleDataItem item)
    { return SimpleDataSource.Instance.Items.IndexO; }

Then use it :
                _MyDataVirtualized =
                    new VirtualizingObservableCollection<SimpleDataItem>(
                        new PaginationManager<SimpleDataItem>(new TesterSource()));
